import React , {useState, useEffect} from 'react'
import {FaHourglass} from 'react-icons/fa'


function Timer() {
    function beep() {
        var snd = new Audio("data:audio/wav;base64,");  
        snd.play();
    }

    const [time, setTime] =useState(Number(6))
    const [running, setRunning] = useState(false);  

    const handleChange=(e)=>    {
        setTime(e.target.value)

    }


    useEffect(() => {
        let interval;
        if (running) {
            if(time===0){
                console.log("time is 0")
                setRunning(false)
                beep();
              }

          interval = setInterval(() => {
            setTime((prevTime) => parseInt(prevTime )- 1);
          }, 1000);

        } else if (!running) {
          clearInterval(interval);
        }
        return () => clearInterval(interval);
      }, [running]);




  return (
    <div>
        <h3> Cronometro para meditación   <FaHourglass/> </h3>

        <div className='container-timer'>
        <input type='number' 
        onBlur={handleChange} ></input> <br></br>
        <button className='btn' onClick={()=>{setRunning(!running)}}></button><br></br>

        <div className='clock' >{time}</div>

        </div>

    </div>



  )
}

export default Timer
